import React, { Component } from 'react';
import Players from './components/players';

class Game extends Component {
    constructor() {
        super();
        this.state = {
            username: 'John',
            allPlayers: []
        }
    }

    render() {
        return (
            <div>
                <h1>{this.state.username}</h1>
                <Players allPlayers={this.state.allPlayers}/>
            </div>
        );
    }
}
 
export default Game;
